import React, { Component } from 'react';
import './App.css';

import {BrowserRouter as Router, Route} from 'react-router-dom';

// console.log(BrowserRouter);


const Home = () => <h1>Home</h1>

class App extends Component {
  render() {
    return (
      <Router >
        <Route path="/" component={Home} />
      </Router>
    );
  }
}

export default App;
